import React from "react";
import Nav from "react-bootstrap/Nav";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { LoginContext } from "../Contexts/LoginContext";
import { AdContext } from "./components/Contexts/AdContext";
import ProtectedRoutes from "../../pages/ProtectedRoutes";

import Rent from "../../pages/Rent";
import Login from "../../pages/Login";
import Update from "../../pages/Update";
import MyAd from "../../pages/MyAd";

import Profile from "../../pages/Profile";

function Navbar_Rental({
  userId,
  isAuth,
  setUserId,
  setIsAuth,
  adId,
  setAdId,
}) {
  const handleSelect = (eventKey) => alert(`selected ${eventKey}`);
  console.log(userId + "Hello");
  return (
    <Router>
      <div>
        <Nav bg="dark" variant="pills" activeKey="1" onSelect={handleSelect}>
          <Nav.Item>
            <Nav.Link as={Link} to={"/rent"}>
              Rent
            </Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link as={Link} to={`/profile/${userId}`}>
              Profile
            </Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link as={Link} to={"/update"}>
              Update Profile
            </Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link as={Link} to={"/create"}>
              Create Ad
            </Nav.Link>
          </Nav.Item>

          <Nav.Item>
            <Nav.Link as={Link} to={"/myadverts"}>
              My Ads
            </Nav.Link>
          </Nav.Item>
        </Nav>
      </div>
      <div>
        <Route path="/rent" component={Rent}></Route>
        <LoginContext.Provider value={{ isAuth, setIsAuth, userId, setUserId }}>
          <Route path="/login" component={Login}></Route>

          <ProtectedRoutes
            path="/profile/:userId"
            component={Profile}
            isAuth={isAuth}
          />
          <ProtectedRoutes path="/update" component={Update} isAuth={isAuth} />
        </LoginContext.Provider>

        <AdContext.Provider value={{ adId, setAdId }}>
          <Route exact={true} path="/myadverts">
            <MyAd />
          </Route>
          <Route path={`/myadverts/:adId`}>
            <Ad_Highlight id_property_ad={adId} />
          </Route>
        </AdContext.Provider>
      </div>
    </Router>
  );
}

export default Navbar_Rental;
